	// @Test
	void test_nonduplicates() {

		long st = System.nanoTime();
		assertEquals(30, test.lengthOfLongestSubstring("ABCDEFGHIJKLMNOPQRSTUVWXYZ1239"));
		long end = System.nanoTime();

		System.out.println("Duration ms:" + (end - st) / 1000000);
	}

	@Test
	void test_perf() {

		IntSupplier supp = () -> test.lengthOfLongestSubstring("ABCDEFGHIJKLMNOPQRSTUVWXYZ1239");

		long st = System.nanoTime();

		IntSummaryStatistics db = IntStream.generate(supp).limit(1000).summaryStatistics();//.average();// 
		
		long end = System.nanoTime();

		System.out.println("Duration ms:" + (end - st) / 1000000 + "-ave=" + db.getAverage());
	}

